import React from "react";
import "./Card.css";

export default function Card({data}) {
  return (
    <>
      <div className="Parent">
        {/* <img src=""/> */}

        <h1>Data</h1>
        <ul>
          {data.map((item) => (
            <li key={item.id}>
              []
            </li>
          ))}

          <p></p>
        </ul>


      </div>
    </>
  );
}
